import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import bookImage from '../images/Book1.webp'; // Path to the image
import './Home.css';


function Home() {
  return (
    <div className="full-page-image">
      <img 
        src={bookImage}
        alt="Books"
        className="img-fluid"
      />
    </div>
  );
}

export default Home;
